const asyncMatch = (evaluate, timeout = 1000, interval = 50) => {
  let ellapsed = 0;
  let timer;

  return async () => {
    return new Promise(resolve => {
      timer = setInterval(() => {
        let result = evaluate();
        if (result || ellapsed >= timeout) {
          resolve(result);
          clearInterval(timer);
        }
        ellapsed += interval;
      }, interval);
    });
  };
};

