const ipmUserDataLoaded = new Promise(resolve => {
  document.addEventListener(Evergage.CustomEvents.OnEventSend, evt => {
    if (evt.detail.actionEvent.action === "IPM User Data") {
      if ((evt.detail.actionEvent.user.attributes.regionCode == null || evt.detail.actionEvent.user.attributes.regionCode == "") && (evt.detail.actionEvent.user.attributes.branchCode == null || evt.detail.actionEvent.user.attributes.branchCode == "")) {
        event.preventDefault();
      }
      resolve(true);
    }

    if (evt.detail.actionEvent.action === "SBS INS Thank You Closed") {
      window.parent.document.getElementById("ins-wc-is-prospect-app").src = "about:blank";
      window.parent.document.getElementById("ipm-modal-DP").style.display = "none";
    }

    if (evt.detail.actionEvent.action === "Closed RS Digital Purchase") {
      Evergage.reinit();
    }
    if (evt.detail.actionEvent.action === "rs-digital-purchase-RS IPM Digital Purchase Completed" && window.parent?.Evergage) {
      if (window.parent?.document.getElementById("ipm-modal-DP")) {
        window.parent.document.getElementById("ipm-modal-DP").style.display = "none";
      }
      if (window.parent?.document.getElementById("loader") && window.parent.document.getElementById("react")) {
        window.parent.document.getElementById("loader").style.display = "block";
        window.parent.document.getElementById("react").style.display = "none";
        setTimeout(() => {
          document.getElementById("react").style.display = "block";
          document.getElementById("loader").style.display = "none";
        }, 300);
      }
      setTimeout(() => {
        window.parent?.Evergage?.reinit();
      }, 200);
    }
  });
});

