const newMatchTimeout = (timeout = 1000) => {
  return new Promise(resolve => {
    setTimeout(() => {
      resolve(false);
    }, timeout);
  });
};

const modalElementAndOptionalIpmUserDataLoaded = (modalSelector, timeout = 1000) => {
  let modalElementLoaded = Evergage.DisplayUtils.pageElementLoaded(modalSelector, "html").then(() => true);

  return () =>
    Promise.race([modalElementLoaded, newMatchTimeout(timeout)]).then(thisModalLoaded => {
      // if modal element not returned within timeout
      // then resolve false (no page match)
      if (!thisModalLoaded) return false;

      // otherwise also wait for ipm user data.
      return Promise.race([
        ipmUserDataLoaded,
        // unless it won't load in time
        newMatchTimeout(timeout)
        // but since modal was found still resolve true (page match)
      ]).then(() => true);
    });
};

const modalElementAndOptionalIpmAdsDataLoaded = (modalSelector, timeout = 5000) => {
  return () =>
    Promise.race([ipmAdsDataLoaded, newMatchTimeout(timeout)]).then(thisModalLoaded => {
      // if modal element not returned within timeout,
      // then resolve false (no page match)
      if (!thisModalLoaded) return false;
      let modalElementLoaded = Evergage.DisplayUtils.pageElementLoaded(modalSelector, "html").then(() => true);

      // otherwise also wait for ipm user data
      return Promise.race([
        modalElementLoaded,
        // unless it won't load in time
        newMatchTimeout(timeout)
        // but since modal was  found still resolve true (page match did happen)
      ]).then(() => true);
    });
};

